// Import VueRouter
import VueRouter from 'vue-router'

// Import pages
import Home from '../pages/Home'
import About from '../pages/About'
import Academic from '../pages/Academic'
import Profession from '../pages/Profession'

export default new VueRouter({
    routes:[
        {
            path: '/home',
            component: Home
        },
        {
            path: '/about',
            component: About
        },
        {
            path: '/academic',
            component: Academic
        },
        {
            path: 'profession',
            component: Profess
        },
    ]
})
